import React, { Component } from "react";
import { VictoryPie } from "victory";

export default class PieChart extends Component {
  componentDidMount() {
    var data = this.props.data;
    data = JSON.parse(
      JSON.stringify(data)
        .split('"label":')
        .join('"x":')
    );
    data = JSON.parse(
      JSON.stringify(data)
        .split('"names":')
        .join('"y":')
    );
    this.props.data = data;
  }
  render() {
    return <VictoryPie data={this.props.data} />;
  }
}
